import { Component } from "react";
import { Container, Col, Row } from "react-bootstrap";
import "./homepage.css"

class Homepage extends Component {
    render(){
        return(
            <div className = "bg">
                <Container>
                <Row>
                    <Col>1 of 2</Col>
                    <Col>2 of 2</Col>
                </Row>
                <Row>
                    <Col>1 of 3</Col>

                    <Col>3 of 3</Col>
                </Row>
                </Container>
            </div>

        )
    }
}
export default Homepage
